import makeStyles from "@material-ui/core/styles/makeStyles"

const useStyles = makeStyles((theme) => ({  
 
    product : {
        backgroundColor : "cyan",
        padding : "5px",
        margin : "1px 20px",
        height:  "300   px",
        minWidth :"360px",
    },
    image : {
        width :"400px",
        backgroundSize : "contain",
        maxWidth: "300px"
    }
}));

export default useStyles;
